begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(6515058727389016)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'COM.JAFR.BOOTSTRAP.CAROUSEL'
,p_display_name=>'Bootstrap Carousel'
,p_supported_ui_types=>'DESKTOP'
,p_plsql_code=>wwv_flow_utilities.join(wwv_flow_t_varchar2(
'FUNCTION f_render_carousel (',
'    p_item                IN apex_plugin.t_page_item,',
'    p_plugin              IN apex_plugin.t_plugin,',
'    p_value               IN VARCHAR2,',
'    p_is_readonly         IN BOOLEAN,',
'    p_is_printer_friendly IN BOOLEAN )',
'    RETURN apex_plugin.t_page_item_render_result ',
'    ',
'  AS  ',
'    -- APEX information',
'    v_app_id    apex_applications.application_id%TYPE := v(''APP_ID'');',
'    v_page_id   apex_application_pages.page_id%TYPE := v(''APP_PAGE_ID'');',
'    ',
'    -- Main plug-in variables',
'    v_result    apex_plugin.t_page_item_render_result; -- Result object to be returned',
'    v_page_item_name    VARCHAR2(100);  -- Item name (different from ID)',
'    v_html  VARCHAR2(4000); -- Used for temp HTML',
'    ',
'    -- Application Plugin Attributes',
'    ',
'    ',
'    -- Item Plugin Attributes',
'    v_image_1    apex_application_page_items.attribute_01%type := p_item.attribute_01; -- Image 1',
'    v_image_2    apex_application_page_items.attribute_02%type := p_item.attribute_02; -- Image 2',
'    v_image_3    apex_application_page_items.attribute_03%type := p_item.attribute_03; -- Image 3',
'    v_interval      apex_application_page_items.attribute_04%type := p_item.attribute_04; -- The amount of time to delay between automatically cycling an item.',
'    v_pause        apex_application_page_items.attribute_05%type := p_item.attribute_05; -- Pauses the cycling of the carousel on mouseenter and resumes the cycling of the carousel on mouseleave.',
'    ',
'    -- Other variables',
'    ',
'  BEGIN',
'    -- Debug information (if app is being run in debug mode)',
'    IF apex_application.g_debug THEN',
'      apex_plugin_util.debug_page_item (p_plugin                => p_plugin,',
'                                        p_page_item             => p_item,',
'                                        p_value                 => p_value,',
'                                        p_is_readonly           => p_is_readonly,',
'                                        p_is_printer_friendly   => p_is_printer_friendly);',
'    END IF;',
'    ',
'    -- handle read only and printer friendly',
'    IF p_is_readonly OR p_is_printer_friendly THEN',
'      -- omit hidden field if necessary',
'      apex_plugin_util.print_hidden_if_readonly (p_item_name             => p_item.name,',
'                                                 p_value                 => p_value,',
'                                                 p_is_readonly           => p_is_readonly,',
'                                                 p_is_printer_friendly   => p_is_printer_friendly);',
'      -- omit display span with the value',
'      apex_plugin_util.print_display_only (p_item_name          => p_item.NAME,',
'                                           p_display_value      => p_value,',
'                                           p_show_line_breaks   => FALSE,',
'                                           p_escape             => TRUE, -- this is recommended to help prevent XSS',
'                                           p_attributes         => p_item.element_attributes);',
'    ELSE',
'      -- Not read only',
'      -- Get name. Used in the "name" form element attribute which is different than the "id" attribute ',
'      v_page_item_name := apex_plugin.get_input_name_for_page_item (p_is_multi_value => FALSE);',
'      ',
'      -- SET VALUES',
'',
'      ',
'      -- OUTPUT',
'      ',
'      ',
'',
'      -- Print Bootstrap Carousel',
'      IF v_interval IS NULL THEN',
'      sys.htp.p(v_interval);',
'      END IF;',
'      ',
'      v_html := ''<div class="carousel slide" %INTERVAL% %PAUSE% id="%ID%" style="width: 1100px">',
'                            <ol class="carousel-indicators">',
'                                <li class="active" data-slide-to="0" data-target="#%ID%"></li>',
'                                <li class="" data-slide-to="1" data-target="#%ID%"></li>',
'                                <li class="" data-slide-to="2" data-target="#%ID%"></li>',
'                            </ol>',
'                            <div class="carousel-inner" role="listbox">',
'                                <div class="item active">',
'                                    <img alt="First slide" src="%IMG_LINK_1%" id="IMG_1">',
'                                </div>',
'                                <div class="item">',
'                                    <img alt="Second slide" src="%IMG_LINK_2%" id="IMG_2">',
'                                </div>',
'                                <div class="item">',
'                                    <img alt="Third slide" src="%IMG_LINK_3%" id="IMG_3">',
'                                </div>',
'                            </div>',
'                            <a class="left carousel-control" data-slide="prev" href="#%ID%" role="button">',
'                                <span aria-hidden="true" class="glyphicon glyphicon-chevron-left"></span> ',
'                                <span class="sr-only">Previous</span>',
'                            </a>',
'                            <a class="right carousel-control" data-slide="next" href="#%ID%" role="button">',
'                                <span aria-hidden="true" class="glyphicon glyphicon-chevron-right"></span>',
'                                <span class="sr-only">Next</span>',
'                            </a>',
'                 </div>'';',
'      ',
'      v_html := REPLACE(v_html, ''%ID%'', p_item.name);',
'      v_html := REPLACE(v_html, ''%IMG_LINK_1%'', v_image_1);',
'      v_html := REPLACE(v_html, ''%IMG_LINK_2%'', v_image_2);',
'      v_html := REPLACE(v_html, ''%IMG_LINK_3%'', v_image_3);',
'      ',
'      IF v_interval IS NULL THEN',
'            v_html := REPLACE(v_html, ''%INTERVAL%'', ''data-ride="carousel"'');',
'      ELSE',
'            v_html := REPLACE(v_html, ''%INTERVAL%'', ''data-interval="'' || v_interval ||''"'' || ''data-ride="carousel"'');',
'      END IF;          ',
'      ',
'      ',
'      ',
'      IF v_pause = ''Y'' THEN',
'            v_html := REPLACE(v_html, ''%PAUSE%'', ''data-pause="hover"'');',
'      ELSE',
'            v_html := REPLACE(v_html, ''%PAUSE%'', ''data-pause=""'');',
'      END IF;     ',
'      ',
'      sys.htp.p(v_html);',
'      ',
'      v_html := ''$(window).load(function() {',
'                            var width = $("#IMG_1").width();',
'                            $("#%ID%").css("width", width);',
'                            });'';',
'      v_html := REPLACE(v_html, ''%ID%'', p_item.name);',
'      apex_javascript.add_onload_code (p_code => v_html);    ',
'      ',
'      -- Load CSS File',
'      apex_css.add_file(',
'         p_name      => ''bootstrap.min'',',
'         p_directory => p_plugin.file_prefix,',
'         p_version   => NULL',
'      );  -- Load bootstrap.min.css',
'      ',
'      -- Load javascript Libraries',
'      apex_javascript.add_library(',
'          p_name => ''bootstrap.min'',',
'          p_directory => p_plugin.file_prefix,',
'          p_version => null); -- Load bootstrap.min.js',
'      ',
'      -- Tell apex that this field is navigable',
'      v_result.is_navigable := FALSE;',
'    END IF; -- f_render_carousel',
'    ',
'    RETURN v_result;',
'  END f_render_carousel;',
'  '))
,p_render_function=>'f_render_carousel'
,p_standard_attributes=>'ELEMENT:ELEMENT_OPTION'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_version_identifier=>'1.0'
,p_about_url=>'http://www.jafr.co'
,p_files_version=>8
);
